<template>
  <div class="LDbox">
    <div class="topback"></div>
    <div class="text">
      <!--<img class="top1" src="../assets/img/top.png" alt="">-->
      <img class="m2" src="../assets/img/ld.jpg" alt="">
      <!--<img class="b1" src="../assets/img/b3.png" alt="">-->
      <ul class="ul">
        <li v-for="(item,ind) in q_list">
          <h2>{{item.problemName}}<p>(必填)</p></h2>

          <h3>{{item.problemNameEnglish}}</h3>
          <el-radio v-for="(row,index) in item.labelList" v-model="item.check_status" :label="row.id" :key="row.id" @change="radioChange(row,index,ind)">{{row.name}}  {{row.nameEnglish}}</el-radio>
        </li>
        <h2>{{mul_choose.problemName}}</h2>
        <p v-if="mul_choose.problemName">(必填，最多选3个)</p>
        <h3>{{mul_choose.problemNameEnglish}}</h3>
        <ul class="biaoqian" style="display: flex;flex-wrap: wrap">
          <li :class="{active:item_.status==1}"  v-for="(item_,i) in multi_choose" @click="bq_click(item_,i)">{{item_.name}} <br>{{item_.nameEnglish}}</li>
        </ul>
        <h2 v-if="qesobj.problemName">{{qesobj.problemName}}<p>(必填)</p></h2>
        <h3>{{qesobj.problemNameEnglish}}</h3>

        <el-input v-if="qesobj.problemName" v-model="qesobj.text" placeholder="请输入内容" type="textarea"></el-input>
        <button @click="submit">提交</button>
      </ul>
    </div>
    <div class="bottom"></div>
  </div>
</template>
<script>
  import Vue from 'vue'
  import api from '../api/api'
  import axios from 'axios'
  export default {
    name: 'index',
    data(){
      return {
        data:{},type:0,
        radio:'',input:'',q_list:[],mul_choose:{},multi_choose:[],xianzhi:[],qesobj:{},transid:'',
      }
    },

    components:{

    },
    created(){

      this.data = JSON.parse(localStorage.obj).data
      this.transid = this.$route.query.transid

      if(this.$route.query.type==2){
        this.$router.push({
          name:'thanks',
          query:{
            storeid:this.data.evaluation.parentId,
            type:2,
            storeUrl:this.data.storeUrl
          },
        })
      }
    },
    mounted(){
      this.getdata(this.data)

    },
    methods:{
      radioChange(e,i,f){
        Vue.set(this.q_list[f].labelList, i, e)
        this.q_list[f].labelList.splice(i, 1, e)
      },
      bq_click(e,i){
        // this.xianzhi=[]
        console.log(e)
        if(this.xianzhi.length<3){
          if(e.status==0){
            e.status=1
            e.index=this.xianzhi.length
            this.xianzhi.push(e)
          }else{
            e.status=0
            this.xianzhi.splice(e.index,1)
            for(var w=0;w<this.xianzhi.length;w++){
              this.xianzhi[w].index=w
            }

            console.log(this.xianzhi)
          }

        }else if(this.xianzhi.length==3&&e.status==1){
          e.status=0
          this.xianzhi.splice(e.index,1)
          for(var w=0;w<this.xianzhi.length;w++){
            this.xianzhi[w].index=w
          }

        }else{
          e.status=0
        }

        console.log(this.xianzhi)

        // console.log(this.multi_choose)
        Vue.set(this.multi_choose, i, e)
        this.multi_choose.splice(i, 1, e)

      },
      getdata(data){
        this.q_list=[]
        var list=data.problemAndLabelList
        console.log(list)
        for(var i=0;i<list.length;i++){
          if(list[i].problemType==1){
            list[i].check_status=0
            this.q_list.push(list[i])
          }else if(list[i].problemType==2){
            for(var j=0;j<list[i].labelList.length;j++){
              list[i].labelList[j].status=0
            }
            this.mul_choose=list[i]
            this.multi_choose=list[i].labelList
          }else if(list[i].problemType==3){
            this.qesobj=list[i]
          }
        }
        console.log(this.q_list)
        console.log(this.mul_choose)
        console.log(this.qesobj)

      },
      submit(){
        var dd=this.data.problemAndLabelList
        var params=[]
        for(var q=0;q<dd.length;q++){
          var obj={problemId:'',problemName:'',grade:'',text:'',labelList:[]}
          obj.problemName=dd[q].problemName
          obj.problemType=dd[q].problemType
          obj.problemId=dd[q].problemId
          obj.grade=dd[q].star_num
          obj.text=dd[q].text
          if(obj.problemType==2){
            console.log(this.xianzhi)
            for(var k=0;k<this.xianzhi.length;k++){
              var obj_={id:'',parentId:'',problemId:'',labelGrade:'',name:''}
              obj_.id=this.xianzhi[k].id
              obj_.parentId=this.xianzhi[k].parentId
              obj_.problemId=this.xianzhi[k].problemId
              obj_.labelGrade=this.xianzhi[k].labelGrade
              obj_.name=this.xianzhi[k].name
              obj.labelList.push(obj_)

            }
            if(obj.labelList.length<1){
              this.$message.error('请填写完必填项');
              return
            }

          }else if(obj.problemType==1){
            for(var k=0;k<dd[q].labelList.length;k++){
              var obj_={id:'',parentId:'',problemId:'',labelGrade:'',name:''}
              if(dd[q].check_status==dd[q].labelList[k].id){
                obj.grade=dd[q].labelList[k].labelGrade
                obj_.id=dd[q].labelList[k].id
                obj_.parentId=dd[q].labelList[k].parentId
                obj_.problemId=dd[q].labelList[k].problemId
                obj_.labelGrade=dd[q].labelList[k].labelGrade
                obj_.name=dd[q].labelList[k].name
                obj.labelList.push(obj_)
              }
              if(dd[q].check_status==0){
                this.$message.error('请填写完必填项');
                return
              }
            }
          }else if(obj.problemType==3){
            console.log(obj)
            if(obj.text==''||obj.text==null){
              this.$message.error('请填写完必填项');
              return
            }
          }
          params.push(obj)
        }
        fetch(api.baseUrl+'/webapi/v4/evaluation/add/'+this.transid,{
          method:'POST',
          headers:{
            "Content-Type":"application/json",
            storeId:this.data.evaluation.parentId,
          },
          body:JSON.stringify(params)
        }).then(r=>r.json()).then(d=>{
          console.log(d)
          if(d.code==200){
            this.$router.push({
              name:'thanks',
              query:{
                storeid:this.data.evaluation.parentId,
                type:1,
                storeUrl:this.data.storeUrl
              },
            })
          }else{
            this.$message.error(d.message);
          }
        })

      }
    },

  }
</script>
<style scoped lang="scss">
  .LDbox{
    width: 100%;
    height:2.3rem;
    button{
      outline:none;
      background:rgb(170,68,33); color:#fff;width: 100%;margin:.2rem auto 0;border-radius: 20px;height:.4rem;line-height: .4rem;border:none;font-size: 14px;
    }
    .biaoqian{
      li{
        margin-right:.05rem;border:1px solid #A6937C;border-radius: 5px;padding:0 5px;height:50px;line-height: 25px;margin-top:.05rem;text-align: center;font-size: .14rem;
      }
      li.active{
        background: #A6937C;color:#fff
      }
    }
    .topback{
      width: 100%;height:100%;
      background-image: url("data:image/jpeg;base64,");
      background-repeat: no-repeat;background-size: 100% 100%;
    }
    .bottom{
      width: 100%;height:1.8rem;
      background-image: url("data:image/jpeg;base64,");
      background-repeat: no-repeat;background-size: 100% 100%;
    }

    .text{
      width: 100%;height:27.5rem;background: #fff;position: relative;overflow: hidden;background-repeat: no-repeat;background-size: 100% 100%;
      background-image: url("data:image/jpeg;base64,");
      .ul > li:nth-of-type(1){
        margin-top: .16rem;
      }
      .top1{
        position: absolute;right:0;top:0;width: 1.8rem;height:1.2rem
      }
      .m2{
        position: absolute;right:.1rem;top:5rem;width: calc(100% - 20px);height:2.5rem
      }
      .ul{
        position: absolute;top:0;left:0;padding: 0 .28rem .2rem;
      }
      .b1{
        position: absolute;right:0rem;top:8rem;width: .8rem;height:.8rem
      }
      li{
        list-style: none;
      }
      h2{
        font-size: .18rem;display: inline-block;
        font-family: 'song';margin-top:.3rem;font-weight: normal;
      }
      p{
        display: inline-block;font-size:.12rem;color:#E7E7E7;margin-left: .1rem;
      }
      h3{
        color:#A6937C;font-weight: normal;font-size: .14rem;margin-bottom: .28rem;
      }
    }

  }



</style>

